const Header = () => {
  return (
    <>
      <header className={styles.header}>
        <div>
          Foodeli
          <span className={styles["food-icon"]}>
            <MdFastfood />
          </span>
        </div>
        <div className={styles["cart-button"]}>
          <button>
            Cart{" "}
            <span>
              <FiShoppingCart />
            </span>
          </button>
        </div>
      </header>
      <div>
        <HeaderImage />
      </div>
    </>
  );
};

export default Header;
